import logo from './logo.svg';
import './App.css';

const Person = (props) => {
  return (
    <>
    <h1>Name: {props.name}</h1>
    <h2>Last Name: {props.lastName}</h2>
    <h2>Age = {props.age}</h2>
    </>
  )
}

const App = () => {
  const name = null;

  return (
    <div className="App">
      <Person name="Nate" lastName={'F'} age={'30'}/>
      <Person name="Mary" lastName={'B'} age={'31'}/>
      <Person name="Jane" lastName={'G'} age={'32'}/>
      <Person name="Homie" lastName={'.'} age={'33'}/>
    </div>
  );
}

export default App;
